import React from "react";
import "./weather.css";

export default function Weather(){
return (
    <div className="weather">
    <h1>Paris</h1>
    <ul>
        <li>Wednesday 07:00</li>
        <li>Partly Cloudy</li>
        <div className="row">
            <div className="col-6">
           <img src="https://openweathermap.org/img/wn/02d@2x.png" alt="Partly Cloudy" /> 
             
            </div>
        </div>
    </ul>
    </div>
)
}
